import React from 'react';  
import {Component} from 'react';  
import './App.css';

const App = () => {
  return (
	<div clasName="App">	
	<Header />	
	<Technoligies /> 	
	</div>
  );
}

const Technologies = () => {
	return(
	<div>	
	  <ul>
		<li>html</li>
		<li>js</li>
		<li>css</li>
		<li>react</li>
	  </ul>
	</div>  
	); 
} 

const Header = () => {
  return (
	<div>	
	<div>one div</div>	
	<div className="App">
		<a href="#">Home</a>
		<a href="#">News Feed</a>
		<a href="#">Messages</a>
	</div>
	</div>
  );
}

export default App;
